import './home.css'
const Home=()=>{
    return(
        <div className='home-container'>
            <h2>Louder<br></br> &More Clearly</h2>
            <p>With the latest technology that produces clearer sound and louder bass.</p>
            <button>More</button>
            <img className='home-img' src='https://res.cloudinary.com/muni/image/upload/v1718197051/SURVIVE/Purple_Modern_Headphone_Shop_Website_Desktop_Prototype-Photoroom_zsr8vt.png'></img>
        </div>
    )
}
export default Home;
